import React, { Component } from 'react';

class Card extends Component {
    render() {
        // console.log(this.props.q)
        return(
            <div>
                <ul>
                    {this.props.q.map(question => {
                        return <li key={question.text}>{question.text}</li>
                    })}
                </ul>
            </div>
        )
    }
}

export default Card;
